/*!
 * Replace no-js on HTML with js
 */
document.documentElement.className = document.documentElement.className.replace(/(\s|^)no-js(\s|$)/, '$1' + 'js' + '$2');

/*!
 * General Helpers
 */
jQuery(function($) {
  // External Link Tracking
  $("a[href*='http://']:not([href*='"+location.hostname+"'])").on('click', function(e){
    try{ ga( 'send', 'event', 'UserAction', 'External Link', this.href ); } catch(err){}
  });

  $('.share').on('click', function(e){
    e.preventDefault();
    $(this).toggleClass('active');
  });

  $('#replay').on('click', function(e){
    e.preventDefault();
    var content = $('#titlebar').html();
    $('#titlebar').html(content);
    $('#vid-header').find('video').get(0).play();
  });

});

/*!
 * Get parameter value from URL or URL string
 * Used by Search and Video Placeholder
 * Updated 2015-12-07
 */
function getURLParameter(href, param) {
  var variables = href.split('?')[1].split('&');
  for (var i = 0; i < variables.length; i++) {
    var paramPairs = variables[i].split('=');
    if (paramPairs[0] == param) {
      return paramPairs[1];
    }
  }
}

/*!
 * Responsive wrapper embeds, iframes, etc
 * @author Erik Runyon
 * Updated 2016-06-03
 * Inspired by https://gist.github.com/davatron5000/e9ef20f1d2ba4d9099711064c644d155
 */
function fitEmbed(embeds){
  for(var i=0; i<embeds.length; i++) {
    var embed = embeds[i],
        width = embed.getAttribute('width'),
        height = embed.getAttribute('height'),
        aspectRatio = height/width,
        parentDiv = embed.parentNode,
        divOuter = document.createElement('div'),
        divInner = document.createElement('div');

    embed.removeAttribute('height');
    embed.removeAttribute('width');

    // Prevents the embed from exceeding the intial width
    divOuter.className = 'embed-outer';
    divOuter.style.maxWidth = width + 'px';
    divInner.className = 'embed-inner';
    divInner.style.paddingBottom = aspectRatio * 100 + "%";
    divOuter.appendChild(divInner);

    embed.parentNode.replaceChild(divOuter, embed);
    divInner.appendChild(embed);
  }
}
var sources = [
      'iframe[src*="youtube.com"]',
      'iframe[src*="vimeo.com"]'
    ],
    embeds = document.querySelectorAll(sources.join(','))
;
if(embeds.length) {
  fitEmbed(embeds);
}

/*!
 * Load ND icons
 */
;( function( window, document ){
  'use strict';

  if(!document.createElementNS || !document.createElementNS('http://www.w3.org/2000/svg', 'svg').createSVGRect){
    return true;
  }

  // var file = 'https://static.nd.edu/images/icons/base-v1.svg',
  var file = 'https://static.nd.edu/images/icons/base-v1.svg',
      version = 0,
      isLocalStorage = 'localStorage' in window && window['localStorage'] !== null,
      request,
      data,
      insertIT = function(){
        document.body.insertAdjacentHTML('afterbegin', data);
      },
      insert = function(){
        if(document.body) insertIT();
        else document.addEventListener('DOMContentLoaded', insertIT);
      }
  ;

  if(isLocalStorage && localStorage.getItem('inlineSVGrev') == version){
    data = localStorage.getItem('inlineSVGdata');
    if(data){
      insert();
      return true;
    }
  }

  try {
    request = new XMLHttpRequest();
    request.open('GET', file, true);
    request.onload = function(){
      if(request.status >= 200 && request.status < 400){
        data = request.responseText;
        insert();
        if(isLocalStorage){
          localStorage.setItem('inlineSVGdata', data);
          localStorage.setItem('inlineSVGrev', version);
        }
      }
    }
    request.send();
  }
  catch(e){}
}(window, document));
var icons = document.querySelectorAll('span.icon');
for(i=0; i< icons.length; i++){
  var el = icons[i],
      className = el.getAttribute('class'),
      dataIcon = el.getAttribute('data-icon'),
      svg = document.createElementNS('http://www.w3.org/2000/svg', 'svg'),
      use = document.createElementNS('http://www.w3.org/2000/svg', 'use')
  ;
  use.setAttributeNS('http://www.w3.org/1999/xlink', 'xlink:href', '#icon-' + dataIcon);
  svg.setAttribute('class', className);
  svg.setAttribute('data-icon', dataIcon);
  svg.appendChild(use);
  el.parentNode.replaceChild(svg, el);
}

/*!
 * Video Placeholder
 * @author Erik Runyon
 * Updated 2016-06-03
 */
jQuery(function($){
  $('.video')
    .append('<div class="play"></div>')
    .on('click', function(e) {
      e.preventDefault();
      var $this = $(this),
          ww = $(window).width(),
          $img = $this.find('img'),
          ratio = $img.height() / $img.width(),
          w = $img.width(),
          h = Math.floor(w * ratio),
          href = $this.attr('href'),
          service = (href.indexOf("vimeo") >= 0) ? 'vimeo' : 'youtube',
          baseurl = (service == "youtube") ? "//www.youtube.com/embed/" : "//player.vimeo.com/video/",
          id = (service == "youtube") ? getURLParameter(href, 'v') : href.split('/').pop()
      ;
      console.log(w,h);
      try{ ga('send', 'event', 'Play Video', $this.attr('href')); } catch(err){}
      $this.parent().html('<iframe data-init="false" width="' + w + '" height="' + h + '" frameborder="0" src="' + baseurl + id + '?autoplay=1&amp;rel=0&amp;wmode=transparent&amp;vq=hd720" webkitallowfullscreen mozallowfullscreen allowfullscreen></iframe>');

      fitEmbed(document.querySelectorAll('iframe[data-init="false"]'));
      document.querySelectorAll('iframe[data-init="false"]')[0].setAttribute('data-init', true);
  });
});

/*!
 * Progress Scroller
 * @author Erik Runyon
 * Updated 2016-12-20
 * Based on https://css-tricks.com/reading-position-indicator/
 */
jQuery(function($){
  var winHeight = $(window).height(),
      docHeight = $(document).height(),
      progressBar = $('progress'),
      max,
      value;

  progressBar.attr('max', docHeight - winHeight);

  $(document).on('scroll', function(){
    topval = $(window).scrollTop();
    progressBar.attr('value', topval);
  });
});

